import React from "react";
import styled from "styled-components";
import PropTypes from "prop-types";
import FatText from "../../Components/FatText";
import Loarder from "../../Components/Loader";

const Wrapper = styled.div`
  height: 50vh;
`;

const Section = styled.div``;

const SearchPresenter = ({ term, loading, data }) => {
  if (term === "undefined") {
    return (
      <Wrapper>
        {term === undefined && <FatText text="Search for something" />}
        {loading && <Loarder />}
        {!loading && data && data.searchUser && data.searchUser.length === 0 ? (
          <FatText text={"해당 검색 유저를 찾을 수 없습니다."} />
        ) : (
          "Found something"
        )}
        {!loading &&
          data &&
          data.searchPost &&
          data.searchPost.length === 0 && (
            <FatText text={"해당 검색 사진을 찾을 수 없습니다."} />
          )}
      </Wrapper>
    );
  }
};

SearchPresenter.propTypes = {
  searchTerm: PropTypes.string,
  loading: PropTypes.bool
};

export default SearchPresenter;
